import React from "react";

function Home () {
    return (
        <h1 id="welcome">Words of Wisdom (or WoW) is a website intended to spread knowledge gained through life experience, fun facts, or whatever you would like! As long as it's kind, it is welcome.</h1>
    )
}

export default Home
